var width = 70;
var height = 70;
var turn = 0;
var auto = false;
var autoSpeed = 500;
autoTimer = setInterval(function() {
  if (auto) { play(); }
}, autoSpeed);


grid = gridInit();

function gridInit(grid = [], replace = true, counter = true, oldGrid = [])
{
	var html = "";
	
	for (var x = 0; x < width; x++)
	{
		if (typeof grid[x] === 'undefined')
		{
			grid[x] = [];
		}
		
		for (var y = 0; y < height; y++)
		{
			if ((typeof grid[x][y] === 'undefined' || !grid[x][y]))
			{
				grid[x][y] = (replace || oldGrid[x][y] === 'undefined') ? false : oldGrid[x][y];
			}
			
			var cell = (grid[x][y]) ? "" : " empty";
			html = html + "<div title='" + x + "." + y + "' name='cell' class='cell" + cell + "' id='" + x + "." + y + "' onclick='toggleCell(this);'></div>";
		}
		html = html + "<br>";
	}
	
	document.getElementById('grid').innerHTML = html;
	turn = (counter) ? turn + 1 : turn;
	document.getElementById('turn').innerHTML = "generation : " + turn;
	
	return grid;
}


function play(gridUpdate = []) {
	// console.log(grid);
	for (var x = 0; x < width; x++)
	{
		gridUpdate[x] = [];
		
		for (var y = 0; y < height; y++)
		{
			gridUpdate[x][y] = checkRules(x, y);
			// console.log(x + "." + y + " -- " + grid[x][y] + "." + gridUpdate[x][y]);
		}
	}
	
	grid = gridInit(gridUpdate);
}

function checkRules(x, y) {
	var alive = 0;
	var dead = 0;

		if (typeof grid[x + 1] !== 'undefined' && x < width) { 
			if (grid[x + 1][y]) { alive = alive + 1; } else { dead = dead + 1; } 
			
			if (typeof grid[x + 1][y + 1] !== 'undefined' && x < width && y >= 0) {
				if (grid[x + 1][y + 1]) { alive = alive + 1; } else { dead = dead + 1; }
			}
			if (typeof grid[x + 1][y - 1] !== 'undefined' && x < width && y >= 0) {
				if (grid[x + 1][y - 1]) { alive = alive + 1; } else { dead = dead + 1; }
			}
		}
		if (typeof grid[x - 1] !== 'undefined' && x >= 0) { 
			if (grid[x - 1][y]) { alive = alive + 1; } else { dead = dead + 1; }
			
			if (typeof grid[x - 1][y + 1] !== 'undefined' && x >= 0 && y < height) {
				if (grid[x - 1][y + 1]) { alive = alive + 1; } else { dead = dead + 1; }
			}
			if (typeof grid[x - 1][y - 1] !== 'undefined' && x >= 0 && y >= 0) {
				if (grid[x - 1][y - 1]) { alive = alive + 1; } else { dead = dead + 1; }
			}
		}
		if (typeof grid[x][y + 1] !== 'undefined' && x < width && y < height) {
			if (grid[x][y + 1]) { alive = alive + 1; } else { dead = dead + 1; }
		}
		if (typeof grid[x][y - 1] !== 'undefined' && x < width && y >= 0) {
			if (grid[x][y - 1]) { alive = alive + 1; } else { dead = dead + 1; }
		}
		// console.log(x + '.' + y + ' -> ' + alive + " .. " + dead + " - " + grid[x][y]);
		
		if (!grid[x][y] && alive == 3) { return true; }
		if (grid[x][y] && (alive == 2 || alive == 3)) { return true; }
		
		return false;
}

function toggleCell(cell) {
    
	var coords = cell.id.split(".");
	
	grid[coords[0]][coords[1]] = (grid[coords[0]][coords[1]]) ? false : true;
	cell.classList.toggle("empty");
};

function exportGrid() {
	// console.log(JSON.stringify(grid));
	document.getElementById("console").value = JSON.stringify(grid);
}

function importGrid() {
	// console.log(document.getElementById("console").value);
	grid = gridInit(JSON.parse(document.getElementById("console").value));
	turn = 1;
	document.getElementById('turn').innerHTML = "generation : " + turn;
}

function resetGrid() {
	grid = gridInit();
	turn = 1;
	
	if (auto) { autoPlay(); }
	document.getElementById('turn').innerHTML = "generation : " + turn;
}

function autoPlay() {
	autoSpeed = document.getElementById('speed').value;
	auto = (auto) ? false : true;
	autoTimer = setInterval(function() {
		if (auto) { play(); }
	}, autoSpeed);
}

